import React from 'react';
import { Link, NavLink } from 'react-router-dom'; // Import Link from react-router-dom
import logo from 'logo.svg'; // Ensure you have imported your logo correctly

const Header = () => {
  return (
    <div id="header-parent-flex">
        <img src={logo} alt="logo" width="100" height="100"/>
        <ul className='flex-me'>
            <li><NavLink to="/">Home</NavLink></li> {/* Use Link component for navigation */}
            <li><NavLink to="/Products">Products</NavLink></li> {/* Link to Products */}
            <li><NavLink to="/Services">Services</NavLink></li> {/* Assuming you have a Services route */}
            <li><NavLink to="/Contact">Contact</NavLink></li> {/* Assuming you have a Contact route */}
        </ul>
    </div>
  );
}

export default Header;
